/* eslint-disable @typescript-eslint/no-unused-expressions */
import styled from 'styled-components';

export const Container = styled.div`
    background-color: #17181F;
    color: #797A81;
    min-height: 100vh;
`;

export const Area = styled.div`
    margin: auto;
    max-width:980px;
    padding:10px
`;
